def average_every_n(lst, n=10):
    return [sum(lst[i:i+n]) / n for i in range(0, len(lst), n) if len(lst[i:i+n]) == n]

def average_of_list(list_of_lists):
    list_of_lists = [np.array(lst) for lst in list_of_lists]
    return np.divide(np.add(*list_of_lists), len(list_of_lists))

